Stepsister EPISODES 01-02

[RAW - Japanese Audio / UNCENSORED / COMPLETE]



Kyosuke, never liked the union between his father and the much younger Megumi. Now that his father is dead he wants her out of the house. Therefore Megumi proposes that Kyosuke can do anything he wants with her daughter Yuna, Kyosuke's younger stepsister if he allows them to stay. But now he wants to sweeten the deal.



